build-script.html.body:
Generate client code using build script
This example generates code using a build script.

Create a new project using cargo: cargo new my_awesome_app

Modify your Cargo.toml to look like this:


[package]
name = "my_awesome_app"
version = "0.1.0"
authors = ["Me "]
edition = "2018"
build = "build.rs"

[dependencies]
# Crates required by the generated code!
failure = "0.1"
futures = "0.1"
parking_lot = "0.8"
reqwest = "0.9"
serde = "1.0"
# Other crates I'm using for this example.
futures-preview = { version = "0.3.0-alpha.16", features = ["compat"], package = "futures-preview" }
runtime = "0.3.0-alpha.7"
runtime-tokio = "0.3.0-alpha.6"

[build-dependencies]
paperclip = "0"


Add my-spec.yaml to the project root with contents from this file.

Now, add build.rs to the project root with the following:


use paperclip::v2::{
    self,
    codegen::{DefaultEmitter, Emitter, EmitterState},
    models::{Api, DefaultSchema},
};

use std::env;
use std::fs::File;

fn main() {
    let fd = File::open("my-spec.yaml").expect("schema?");
    let raw: Api = v2::from_reader(fd).expect("deserializing spec");
    let schema = raw.resolve().expect("resolution");

    let out_dir = env::var("OUT_DIR").unwrap();
    let mut state = EmitterState::default();
    // set prefix for using generated code inside `codegen` module (see main.rs).
    state.mod_prefix = "crate::codegen::";
    state.working_dir = out_dir.into();

    let emitter = DefaultEmitter::from(state);
    emitter.generate(&schema).expect("codegen");
}


Now, you can modify src/main.rs to make use of the generated code:

#[macro_use] extern crate failure;
#[macro_use] extern crate serde;

use failure::Error;
use futures_preview::compat::Future01CompatExt;
use reqwest::r#async::Client;

mod codegen {
    #![allow(dead_code)]
    include!(concat!(env!("OUT_DIR"), "/mod.rs"));
}

use self::codegen::client::Sendable;
use self::codegen::pet::Pet;

#[runtime::main(runtime_tokio::Tokio)]
async fn main() -> Result {
    let client = Client::new();
    let pets = Pet::list_pets().send(&client).compat().await?;
    Ok(())
}

Some things to note:

I'm using async/await only to demonstrate the usage of the generated code. The generated client code uses the old futures 0.1 and won't switch to the new syntax until it's stablilized.
The names of associated functions for each operation (such as list_pets) is obtained from operationId fields. But since it's optional and if the user has ignored it in their spec, then we use HTTP methods and number them if there are more than one.
The emitter tries to bind each operation to some model (based on body parameters and 2xx responses). If it cannot bind it, then they're ignored (at this point).

Compile-time checks?
API calls often require some parameters. Should we miss those parameters when performing a request, either the client will produce a runtime error or the server will reject our request. Our generated client code on the other hand, uses markers to avoid this problem at compile-time.
For example, in order to fetch a pet, petId parameter is required. Let's change the main function in the above example to fetch a pet without its ID.
let pet = Pet::get_pet_by_id().send(&client).compat().await?;

If we try and compile the program, then we'll get the following error:
error[E0599]: no method named `send` found for type
`codegen::pet::PetGetBuilder1`
in the current scope
Note that the struct PetGetBuilder1 has been marked with MissingPetId. And, send is implemented only when the builder has PetIdExists marker.
Hence the fix would be to set the required parameter using the relevant method call (which transforms the builder struct).
let pet = Pet::get_pet_by_id()
    .pet_id(25)
    .send(&client)
    .compat().await?;

... and the code will compile.
The same applies to using API objects (with required fields). For example, the addPet operation requires Pet object to be present in the HTTP body, but then Pet object itself requires id and name fields.
So, if we did this:
let pet = Pet::add_pet().send(&client).compat().await?;

... we'd get an error during compilation:
no method named `send` found for type `codegen::pet::PetPostBuilder` in the current scope
As we can see, the builder struct has been marked with MissingId and MissingName, but again send is implemented only if the struct had IdExists and NameExists markers.
Now, we change the code to:
let pet = Pet::add_pet()
    .id(25)
    .name("Milo")
    .send(&client)
    .compat().await?;

... and the code will compile.

NOTE: The types of arguments are also checked.

actix-plugin.html.body:
Host OpenAPI v2 spec through actix-web
With actix feature enabled, paperclip exports an experimental plugin for actix-web framework to host OpenAPI v2 spec for your APIs automatically. While it's not feature complete, you can rely on it to not break your actix-web flow.
Let's start with a simple actix-web application. It has actix-web and serde for JSON'ifying your APIs. Let's also add paperclip with actix feature.
# [package] ignored for brevity

[dependencies]
# NOTE: Requires `actix-web = "^1.0.4"`
actix-web = "1.0.4"
paperclip = { version = "0.3", features = ["actix"] }
serde = "1.0"

Our main.rs looks like this:
use actix_web::{App, web::{self, Json}};
use serde::{Serialize, Deserialize};

#[derive(Serialize, Deserialize)]
struct Pet {
    name: String,
    id: Option,
}

fn add_pet(_body: Json) -> Json {
    unimplemented!();
}

fn main() -> std::io::Result {
    let server = HttpServer::new(|| App::new()
        .service(
            web::resource("/pets")
                .route(web::post().to(add_pet))
        )
    ).bind("127.0.0.1:8080")?
    .run()
}

Now, let's modify it to use the plugin!
use actix_web::{App, HttpServer};
use paperclip::actix::{
    // extension trait for actix_web::App and proc-macro attributes
    OpenApiExt, api_v2_schema, api_v2_operation,
    // use this instead of actix_web::web
    web::{self, Json},
};
use serde::{Serialize, Deserialize};

// Mark containers (body, query, parameter, etc.) like so...
#[api_v2_schema]
#[derive(Serialize, Deserialize)]
struct Pet {
    name: String,
    id: Option,
}

// Mark operations like so...
#[api_v2_operation]
fn add_pet(_body: Json) -> Json {
    unimplemented!();
}

fn main() -> std::io::Result {
    HttpServer::new(|| App::new()
        // Record services and routes from this line.
        .wrap_api()
        // Mount the JSON spec at this path.
        .with_json_spec_at("/api/spec")
        // Everything else is the same!
        .service(
            web::resource("/pets")
                .route(web::post().to(add_pet))
        )
        // Build the app!
        .build()
    ).bind("127.0.0.1:8080")?
    .run()
}

We have:

Imported OpenApiExt extension trait for actix_web::App along with api_v2_schema and api_v2_operation proc macro attributes.
Switched from actix_web::web to paperclip::actix::web.
Marked our Pet struct and add_pet function as OpenAPI-compatible schema and operation using proc macro attributes.
Transformed our actix_web::App to a wrapper using .wrap_api().
Mounted the JSON spec at a relative path using .with_json_spec_at("/api/spec").
Built (using .build()) and passed the original App back to actix-web.

Note that we never touched the service, resources, routes or anything else! This means that our original actix-web flow is unchanged.
Now, testing with cURL:
curl http://localhost:8080/api/spec
... we get the swagger spec as a JSON!
// NOTE: Formatted for clarity
{
  "swagger": "2.0",
  "definitions": {
    "Pet": {
      "properties": {
        "id": {
          "type": "integer",
          "format": "int64"
        },
        "name": {
          "type": "string"
        }
      },
      "required": ["name"]
    }
  },
  "paths": {
    "/pets": {
      "post": {
        "responses": {
          "200": {
            "schema": {
              "$ref": "#/definitions/Pet"
            }
          }
        }
      },
      "parameters": [{
        "in": "body",
        "name": "body",
        "required": true,
        "schema": {
          "$ref": "#/definitions/Pet"
        }
      }]
    }
  }
}

Similarly, if we were to use other extractors like web::Query, web::Form or web::Path, the plugin will emit the corresponding specification as expected.
Known limitations

Enums: OpenAPI (v2) itself supports using simple enums (i.e., with unit variants), but Rust and serde has support for variants with fields and tuples. I still haven't looked deep enough either to argue that this cannot be done in OpenAPI or find an elegant way to represent this in OpenAPI.
Functions returning abstractions: The plugin has no way to obtain any useful information from functions returning abstractions such as HttpResponse, impl Responder or containers such as Result containing those abstractions. So, the plugin silently ignores these types, which results in an empty value in your hosted specification.

Missing features
At the time of this writing, this plugin didn't support a few OpenAPI v2 features:



Affected entity
Missing feature(s)




Parameter
Non-body parameters allowing validations like allowEmptyValue, collectionFormat, items, etc.


Parameter
Headers as parameters.


Responses
Response codes other than 200 OK.


Security (definitions and requirements)
Authentication and Authorization.



Performance implications?
Even though we use some wrappers and generate schema structs for building the spec, we do this only once i.e., until the .build() function call. At runtime, it's basically an Arc deref and RwLock read, which is quite fast!
We also add a wrapper to blocks in functions tagged with #[api_v2_operation], but those wrappers are unit structs and the code eventually gets optimized away anyway.
